import { SAVE_TODO } from "../common/types";

export const loadList = () => async (dispatch: any) => {
  try {
    dispatch({
      type: SAVE_TODO,
      payload: [
        {
          id: Date.now() ,
          name: "zrobic kupe",
          checked: false,
        },
        {
          id: 1,
          name: "spacer",
          checked: false,
        },
        {
          id: 2,
          name: "rower",
          checked: false,
        },
      ],
    });
  } catch (err) {
    console.log(`err`, err);
  }
};
